import Prosses_medical from './Prosses_medical';
import imglog from 'd1.jpg'
const Containt = () => {


    return (
        <body>
            <div className="containt">
                <img src={imglog} alt='' />
                <Prosses_medical />
            </div>


        </body>

    );
}
export default Containt;
